하아...  스포일까봐 댓글 안달았는데 오늘 베댓이;;;;;;
근친상간 아니구요.
신의 영역에 도전했다는 대사는 왜 안보시는지...

그렇군 이렇게 비밀을 안고 1부가 끝나내요 작가님 2부 기다리고있겠습니다!!
자!!!!
그럼 코난님들 이해못하겠으니 설명좀 해주십쇼...;

아 왜 고양이한테 그래 
고양이 키우는 사람 입장에서 
고양이를 저런식으로 표현하신건 좀 아닌듯해요;

오역 의역 많아요..
&lt;유명인사 레온딘. 충격적 죽음&gt;
아놀드 G, 레온딘 경이 서포크주 베리세인트에드먼즈에 있는 자신의 사유지에서 죽은채로 발견되었다. 경찰 조사에 따르면 용의자는 놀랍게도 그의 아내인 헬레나 레온딘. 사인은 복부에 맞은 탄환으로 인한 과다출혈이다. 범죄의 동기가 아직 명확하게 밝혀지지 않았으나, 익명을 요구한 메이드가 &quot;마님은 정신적으로나 육체적으로나 상태가 좋지 못했다.. 가련한 그녀의 영혼에 신께서 자비를 베푸시길 기도할것&quot; 이라고 증언했다. (중략)

아하하. 저는 느무궁금해서 결국책을 샀네요 ㅡㅡ;;
그래도 그림으로 보니깐 넘좋아여 ^^* 
작가님 ♡

이편 대충보고 넘겻는데 자기아내를 상대로 실험을했단말인가? 싸이코패스네;;;
산후우울증이 생기면 몸에좋은음식 이것저것 다 챙겨줘도 모자랄망정 자궁적출이라니..
릴리안보다 헬레나얘기가 더 몰입감쩌네요.

릴리안 엄마 때랑 똑같은 상황이 반복되는구나..

&quot;이번엔 절대 실망시키지 않을게요&quot;

실망시키겠다고 예고하는건가..;;
